    false,nt"url": null,nt"notes": "This data set portrays labor statistics
    annual averages for the years 2002 to 2004, shown by county, for the United States
    and Puerto Rico. The data set was created by merging data from the Bureau of Labor
    Statistics with a file showing year 2001 county boundaries. Included is the total
    labor force, the number of employed and unemployed, and the unemployment rate for
    each county. This is a replacement for the November 2004 Labor Statistics for the
    United States ? Annual Averages for 2002 and 2003 data set, with data for 2004 added.
    This is an updated version of the September 2005 file; values for 2002 and 2003
    were updated.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
